import React, {Component} from 'react';
import './style.css';
import { useDispatch } from "react-redux";
import { useParams } from "react-router-dom";
import { useEffect, useState } from "react";
import Order from "../../components/Order";

export default class HeaderComponent extends Component{


  render(){



const OrderDetails = () => {
  const dispatch = useDispatch();
  const { orderId } = useParams();
  const [value, setValue] = useState("description");
  const [order, setorder] = useState(null);
  const [orders, setorders] = useState([]);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  async function getOrder() {
    const order = await fetch(
      `http://localhost:1337/api/orders/2`,
      {
        method: "GET",
      }
    );
    const orderJson = await order.json();
    dispatch(setOrder(orderJson.data));
  }

  async function getOrders() {
    const order = await fetch(
      `http://localhost:1337/api/orders`,
      {
        method: "GET",
      }
    );
    const ordersJson = await orders.json();
    dispatch(setOrders(ordersJson.data));
  }

  useEffect(() => {
    getOrder();
    getOrders();
  }, [orderId]); // eslint-disable-line react-hooks/exhaustive-deps

   }
    return(
        <body>
          <article>
            <address>
              <p> Infosys LTD </p>            
            </address>        

            <table className="firstTable">
              <tr>
                <th><span >Invoice #</span></th>
                <td><span >101138</span></td>
              </tr>
              <tr>
                <th><span >Date</span></th>
                <td><span >January 1, 2012</span></td>
              </tr>
            </table>

            <table className="secondTable">
              <thead>
                <tr>
                  <th><span >Order</span></th>
                  <th><span >Description</span></th>
                  <th><span >Rate</span></th>
                  <th><span >Quantity</span></th>
                  <th><span >Price</span></th>
                </tr>
              </thead>
              <tbody>
                <tr>
                  <td><a class="cut">-</a><span >Front End Consultation</span></td>
                  <td><span >Experience Review</span></td>
                  <td><span data-prefix>$</span><span >150.00</span></td>
                  <td><span >{count}</span></td>
                  <td><span data-prefix>$</span><span>600.00</span></td>
                </tr>
              </tbody>
            </table>
            <table className="firstTable">
              <tr>
                <th><span >Sub-Total</span></th>
                <td><span data-prefix>$</span><span>600.00</span></td>
              </tr>
              <tr>
                <th><span >GST</span></th>
                <td><span data-prefix>$</span><span >0.00</span></td>
              </tr>
              <tr>
                <th><span >Total</span></th>
                <td><span data-prefix>$</span><span>600.00</span></td>
              </tr>
            </table>                      
          </article>
{ /* 
          <aside>
            <h1 id="notes">Additional Notes</h1>
            <div >
              <p>A finance charge of 1.5% will be made on unpaid balances after 30 days.</p>
            </div>
          </aside> */} 

        </body>
    )
  }
}
